}

const Display = (props: Props) => {
    const {
        result,
        isCalc
    } = props;

    console.log(result);
    
    return (
        <section className="right-side">
        <div className="display">
          <h5>Tip Amount <br/> <p>/ people</p></h5>
          <h1 id="tipAmount">{}</h1>
        </div>
        <div className="display">
          <h5>Total <br/> <p>/ people</p></h5>
          <h1 id="total">{}</h1>
        </div>
        <div className="container">
          <button
          disabled={true}
          onClick = {e =>{
            e.preventDefault();
            
          }}
          >RESET</button>
          <button type='button'
          disabled={!isCalc}
          onClick = {e => {
            e.preventDefault();

          }}
          >CAL</button>
        </div>
      </section>
    );
  };
  export default Display;
